def build_letter_count(word):
    answer = {}
    for c in word:
        if c in answer.keys():
            answer[c] = answer[c] + 1
        else:
            answer[c] = 1
    return answer
def compare(dict_worda, dict_wordb):
    return dict_worda == dict_wordb
def per(worda, wordb):
    dict_a = build_letter_count(worda)
    dict_b = build_letter_count(wordb)
    print(dict_a)
    return compare(dict_a, dict_b)
    
    
